import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useCookies } from "react-cookie";

// Material-UI Components
import { AppBar, Box, Toolbar, Typography, Button, IconButton, Menu, MenuItem, useTheme, useMediaQuery } from "@mui/material";
// Material-UI Icon
import MenuIcon from '@mui/icons-material/Menu';

export const Navbar = () => {
  const [cookies, setCookies] = useCookies(["access_token"]);
  const navigate = useNavigate();

  // Hooks for responsive menu
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down("sm"));
  const [anchorEl, setAnchorEl] = useState(null);

  const handleMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const logout = () => {
    handleClose();
    setCookies("access_token", "");
    window.localStorage.clear();
    navigate("/auth");
  };

  const NavLink = ({ to, label, onClick }) => (
    <Button
      color="inherit"
      component={onClick ? Button : Link}
      to={to}
      onClick={onClick}
      sx={{ my: 2, display: 'block' }}
    >
      {label}
    </Button>
  );

  const MobileNavLink = ({ to, label, onClick }) => (
    <MenuItem
      component={onClick ? MenuItem : Link}
      to={to}
      onClick={onClick}
    >
      {label}
    </MenuItem>
  );

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" elevation={3} sx={{ backgroundColor: "#212121" }}>
        <Toolbar>
          <Typography
            variant="h6"
            component={Link}
            to="/"
            sx={{ flexGrow: 1, textDecoration: "none", color: "inherit" }}
          >
            Memories
          </Typography>

          {isMobile ? (
            <>
              <IconButton
                size="large"
                edge="start"
                color="inherit"
                aria-label="menu"
                onClick={handleMenu}
              >
                <MenuIcon />
              </IconButton>
              <Menu
                id="menu-appbar"
                anchorEl={anchorEl}
                anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
                keepMounted
                transformOrigin={{ vertical: 'top', horizontal: 'right' }}
                open={Boolean(anchorEl)}
                onClose={handleClose}
              >
                <MobileNavLink to="/" label="Home" onClick={handleClose} />
                <MobileNavLink to="/create-memory" label="Create Memory" onClick={handleClose} />
                {!cookies.access_token ? (
                  <MobileNavLink to="/auth" label="Login/Register" onClick={handleClose} />
                ) : (
                  [
                    <MobileNavLink key="saved" to="/saved-memories" label="Saved Memories" onClick={handleClose} />,
                    <MobileNavLink key="logout" label="Logout" onClick={logout} />
                  ]
                )}
              </Menu>
            </>
          ) : (
            <Box>
              <NavLink to="/" label="Home" />
              <NavLink to="/create-memory" label="Create Memory" />
              {!cookies.access_token ? (
                <NavLink to="/auth" label="Login/Register" />
              ) : (
                <>
                  <NavLink to="/saved-memories" label="Saved Memories" />
                  <NavLink label="Logout" onClick={logout} />
                </>
              )}
            </Box>
          )}
        </Toolbar>
      </AppBar>
    </Box>
  );
};
